import React from "react";
import ItemDetailContainer from "../ItemDetailContainer"


function HomeScreen(data) {
  return (
    <div>
      <header>
        <a href="/">Home</a>
      </header>
      <main>
        <h1>Inmuebles Disponibles</h1>
        {
          data.inmueble.map(inmueble => (<div key={inmueble.slug} className="products">
          <img src={inmueble.image} alt={inmueble.name} />
          <p>
            {inmueble.name}
          </p>
          <p>
            {inmueble.price}
          </p>

          </div>))
        }
      </main>
    </div>
  )
}

export default HomeScreen;
